import { Link } from 'react-router-dom';

const SupervisorMenu = () => (
  <>
    <Link to="/dashboard/supervisor" className="hover:text-purple-600 font-semibold">หน้าหลัก</Link>
    <Link to="/supervisor/evaluation" className="hover:text-purple-600">ประเมินนิสิต</Link>
    <Link to="/supervisor/profile" className="hover:text-purple-600">โปรไฟล์</Link>
  </>
);

export default SupervisorMenu;
